import './Login.css';
import axios from 'axios';
import AppContext from '../../Context/AppContext';
import {useHistory} from 'react-router';
import {useContext, useState} from 'react';

const Login = () => {
    const {dispatch} = useContext(AppContext);
    const [userInput, setUserInput] = useState({email: "", password: ""});
    const [errorMessage, setErrorMessage] = useState(null);
    console.log(dispatch);
    return(
        <>
            <div className="form-login mt-5 mb-5">
                <div className="form-login-container">
                    <h5 className='login-text-header text-center'>Login Account</h5>
                    <form className='form-login-form' autoComplete='off'>
                        <div className='form-group'>
                            <input type='email' className='form-control' id='email-login' name='email-login' placeholder='Email'/>
                            <span className='error-message'></span>
                        </div>
                        <div className='form-group mt-4'>
                            <input type='password' className='form-control' id='password-login' name='password-login' placeholder='Password'/>
                            <span className='error-message'></span>
                        </div>
                        <div className='form-group text-right mt-4'>
                            <button type='submit' className='btn btn-center'>Login</button>
                        </div>
                    </form>
                </div>
            </div>
        </>
    )
}
export default Login;
